import s from './CenterHeader.module.css'


const CenterHeader = () => {

    return (
        <div className={s.center_header}>
            <div className={s.center_header_container}>
                <div className={s.center_header_container_text}>
                    <span>Смачне й швидке</span>
                    <h2>Меню доставки</h2>
                    <p>Зробіть швидке замовлення, якщо Ви впевненні у своєму смаку та побажаннях. Якщо ні – для Вас є повне меню зі зручними фільтрами для пошуку у розділі Меню.</p>
                </div>
            </div>
        </div>
    )

}

export default CenterHeader;
